import { ResultRenderer } from '../components/ResultRenderer';
import { ReactComponentLike } from 'prop-types';
import React from 'react';
import { createStyles, ListItem, ListItemText } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { FixedSizeList, ListChildComponentProps } from 'react-window';

const useStyles = makeStyles((theme: any) =>
    createStyles({
        root: {
            width: '100%',
            height: 400,
            maxWidth: 300,
            backgroundColor: '#ddd'
        },
    }),
);
function renderRow(props: ListChildComponentProps) {
    const { index, style } = props;
    console.log(props)
    const item = props.itemData.results[props.index];
    return (
        <ListItem button style={style} key={index}>
            <ResultRenderer type={props.itemData.type} data={item}/>
        </ListItem>
    );
}
export const VirtualizedList: React.FunctionComponent<{itemData: any; }> = (props) => {
    const classes = useStyles();
    const { itemData } = props;

    return (
        <div className={classes.root}>
            <FixedSizeList height={400} width={300} itemSize={50} itemCount={itemData.results.length}>
                {renderRow}
            </FixedSizeList>
        </div>
    );
}
